import React from 'react'
import {Link,  NavLink } from 'react-router-dom'
import styles from './MainNavigation.module.css'
function MainNavigation() {
  return (
    <header className={styles.header}>
      <nav>
        <ul className={styles.list}>
          <li><Link className={({ isActive }) =>{ 
            console.log(isActive)
            return isActive ? styles.active : undefined
          }} to='/home'>Home</Link></li>
          <li><Link className={({ isActive }) => isActive ? styles.active : undefined} to='/products'>Products</Link></li>
          <li><Link className={({ isActive }) => isActive ? styles.active : undefined} to='/about'>About</Link></li>
        </ul>
      </nav>
    </header>
  )
}

export default MainNavigation
